demo.repl.help:
Налични команди:
  @show              ─ покажи последното резюме на adaptive card
  @json              ─ изведи суровата JSON стойност, получена от потока
  @back              ─ върни към предишната блокирана карта/входове
  @input <k>=<v>     ─ задай или презапиши входно поле
  @click <action_id> ─ изпрати картата с предоставеното действие
  @help              ─ отпечатай този помощен текст
  @quit              ─ изход от REPL
